import styled from 'styled-components';
import {useState} from 'react';
import axios from 'axios';

const Container = styled.div`
display: flex;
flex-direction: column;
align-items: center;
margin: 10px;
width: 100%;
`;

const BalanceBox = styled.div`
display: flex;
flex-direction: row;
justify-content: space-between;
align-items: center;
font-size: 18px;
width: 100%;
font-weight: bold;
`;

const AddTransaction = styled.button`
background: black;
color: white;
padding: 5px 10px;
border-radius: 4px;
cursor: pointer;
font-weight: bold;
font-size: 15px;
justify-content: space-between;
`;

const AddTransactionContainer = styled.div`
display: flex;
flex-direction: column;
border: 1px solid #e6e8e9;
gap: 10px;
width: 100%;
padding: 15px 20px;
margin: 20px;
& input{
    outline: none;
    padding: 10px 12px;
    border-radius: 4px;
    border: 1px solid #e6e8e9;
}
`;

const RadioBox = styled.div`
display: flex;
flex-direction: row;
width: 100%;
align-items: center;
& input {
    width: unset;
    margin: 0 10px;
}
`;

const ExpenseContainer = styled.div`
display: flex;
flex-direction: row;
gap: 12px;
margin: 20px;
`;

const ExpenseBox = styled.div`
display: flex;
flex-direction: column;
border-radius: 4px;
border: 1px solid #e6e8e9;
padding: 15px 20px;
width: 125px;
font-size: 14px;
& span {
    font-weight: bold;
    font-size: 20px;
    color: ${(props) => (props.isIncome? "green" : "red")}
}
`;


const AddTransactionView = (props) => {

    const data = {
        amount : "",
        desc : "", 
        type : ""
    }

    const [expenseData, setExpenseData] = useState(data);

    const inputChangeHandler = (e) => {

        setExpenseData({...expenseData, [e.target.name]: e.target.value});
    }



    const transactionHandler = () => {
        props.addTransaction({
            amount: Number(expenseData.amount),
            desc: expenseData.desc,
            type: expenseData.type,
            id: Date.now(),
        });

        axios.post("https://expense-tracker-fe43e-default-rtdb.firebaseio.com/expenseData.json", expenseData)
            .then((res) => {
                if (res.status === 200) {
                    console.log("Transaction added successfully!");
                }
            })
            .catch((err) => {
                console.error("Error adding transaction:", err);
            });

        // Reset form data after adding
        setExpenseData({
            amount: "",
            desc: "",
            type: ""
        });

        props.setAddTransaction();
    };


    return (
        <AddTransactionContainer>
            <input placeholder="Amount" name='amount' value={expenseData.amount} onChange={inputChangeHandler} type="number" autoFocus/>
            <input placeholder="Description" name='desc' value={expenseData.desc} onChange={inputChangeHandler} type="text" />
            <RadioBox>
                <input type="radio" id="expense" name="EXPENSE" value={expenseData.type} checked={type==="EXPENSE"} onChange={inputChangeHandler} />
                <label htmlFor='expense' >Expense</label>
                <input type="radio" id="income" name="INCOME" value={expenseData.type} checked={type==="INCOME"} onChange={inputChangeHandler} />
                <label htmlFor='income' >Income</label>
            </RadioBox>
            <AddTransaction onClick={transactionHandler}>Add Transaction</AddTransaction>
        </AddTransactionContainer>
    );

};

const OverviewComponent = (props) => {

    const [addTransaction, setAddTransaction] = useState(false);

    const AddTransactionHandler = () => {
         setAddTransaction(!addTransaction);
    }

   return (
    <Container>
        <BalanceBox>
            Balance ${props.income - props.expense}
            <AddTransaction onClick={AddTransactionHandler} > {addTransaction? "CANCLE" : "ADD"} </AddTransaction>
        </BalanceBox>
        {addTransaction && <AddTransactionView setAddTransaction = {setAddTransaction}
        addTransaction = {props.addTransaction}
         />}
        <ExpenseContainer>
            <ExpenseBox isIncome={false}>
                Expense<span>${props.expense}</span>
            </ExpenseBox>
            <ExpenseBox isIncome={true}>
                Income<span>${props.income}</span>
            </ExpenseBox>
        </ExpenseContainer>

    </Container>
   );
}

export default OverviewComponent;
